import React, { Component, useState } from 'react';
import {Text,View, TextInput} from 'react-native'
import Accordion from 'react-native-collapsible/Accordion';
import style from './stylesheet'
import SearchBar from "react-native-dynamic-search-bar";
import ClientsTotal2 from "../Data"

const ClientsTotal = [
  {
      name: "André"
      ,Pontos:"15"
      ,CPF:"323.935.458-67"
      ,Telefone:"11988269888"
  },
  {
      name:"Mariaa"
      ,Pontos:"155"
      ,CPF:"59845245718"
      ,Telefone:"11885299595"
  },
  {
    name: "Emanuel"
    ,Pontos:"1520"
    ,CPF:"25295874525"
    ,Telefone:"11988269888"
},
{
    name:"Lucas"
    ,Pontos:"8"
    ,CPF:"52585295867"
    ,Telefone:"11955249565"
},
{
  name: "Rogério"
  ,Pontos:"0"
  ,CPF:"2017524859"
  ,Telefone:"21574185244"
},
{
  name:"João"
  ,Pontos:"3"
  ,CPF:"52148474878"
  ,Telefone:"11784845555"
},
{
  name: "Alice"
  ,Pontos:"115"
  ,CPF:"85877785485"
  ,Telefone:"119898989898"
},
{
  name:"Peterson"
  ,Pontos:"20"
  ,CPF:"55522299965"
  ,Telefone:"11588585000"
},
{
  name: "Letícia"
  ,Pontos:"11"
  ,CPF:"87555511211"
  ,Telefone:"11955559999"
},
{
  name:"Maria Meneguel"
  ,Pontos:"3"
  ,CPF:"55521452152"
  ,Telefone:"21952525252"
},
{
  name: "Gabriel Eloy"
  ,Pontos:"51"
  ,CPF:"58541522222"
  ,Telefone:"11988269888"
},
{
  name:"Keiko Shimane"
  ,Pontos:"0"
  ,CPF:"22233366655"
  ,Telefone:"11999521111"
},
];

class Search extends Component {
  state = {
    activeSections: [],
    collapsed:true,
    multiSelect:false,
    Clients: ClientsTotal,
  };

toggleExpanded = () => {
  this.setState({ collapsed: !this.state.collapsed });
};

  _renderHeader = section => {
    return (
      <View>
        <Text style={style.name}>{section.name}</Text>
      </View>
    );
  };

  _renderData = section => {
    return (
      <View>
        <Text>
        <Text style={style.DataTitle}>Pontos:</Text> {section.Pontos}
        </Text>
        <Text>
          <Text style={style.DataTitle}>CPF:</Text> {section.CPF}
        </Text>
        <Text>
          <Text style={style.DataTitle}>Tel:.</Text>{section.Telefone}
        </Text>
      </View>
    );
  };

  _updateSections = section => {
    this.setState({ activeSections: section.includes(undefined)?[]:section});
  };


 filterList(text) {
  // var input, filter, ul, li, a, i, txtValue;
  // input = document.getElementById("myInput");
  // filter = input.value.toUpperCase();
  // ul = document.getElementById("myUL");
  // li = ul.getElementsByTagName("li");
  var _Clients=[]
  let str
  let textUpper
  
  if (text===""){
    _Clients=ClientsTotal
  } else{
    for(var i=0; i<ClientsTotal.length; i++) {
      for(var key in ClientsTotal[i]) {
        str = ClientsTotal[i][key].toUpperCase()
        textUpper = text.toUpperCase()
        if(str.indexOf(textUpper)!==-1) {
           _Clients.push(ClientsTotal[i]);
        }
        
      }
    }
  }

  this.setState({
    Clients :_Clients,
    activeSections :[]
  })
      // this._updateSections
      // this._renderData
      // this._renderHeader
  }

  render() {
    return (
      <View style={style.firstView}>
        <SearchBar
          fontColor="#c6c6c6"
          iconColor="#c6c6c6"
          shadowColor="#282828"
          cancelIconColor="#c6c6c6"
          backgroundColor="#353d5e"
          placeholder="Digite o nome, cpf ou telefonee"
          onChangeText={(text) => {
            this.filterList(text);
          }}
          onPressCancel={() => {
            this.filterList("");
          }}
          onPress={()=> {this.setState({activeSections :[]})}}
        />
         <View style={style.accordion}>
          <Accordion
              sections={this.state.Clients}
              activeSections={this.state.activeSections}
              //renderSectionTitle={this._renderSectionTitle}
              renderHeader={this._renderHeader}
              renderContent={this._renderData}
              onChange={this._updateSections}
          />
         </View>
      </View>
    );
  }
}

export default Search
